import UIKit

@IBDesignable class ChannelImageView: UIView {

	override func prepareForInterfaceBuilder() {
		self.image = UIImageView(image: UIImage(data: NSData(base64EncodedString: channelImageDesignImage, options:NSDataBase64DecodingOptions.IgnoreUnknownCharacters)!))
		self.loadImage()
	}
	var imageURL:String?{
		didSet{
			self.image!.updateImage(self.imageURL!)
		}
	}
	var image:UIImageView?
	func loadImage(){
		self.contentMode = UIViewContentMode.ScaleAspectFill
		self.backgroundColor = UIColor.clearColor()
		self.layer.masksToBounds = true
		self.layer.cornerRadius = self.frame.size.height / 2
		if let img = self.image{
			img.frame = CGRect(x: 0, y: 0, width: self.frame.width, height: self.frame.height)
			self.addSubview(img)
		}

	}
	override  func willMoveToSuperview(newSuperview: UIView?) {
		if newSuperview != nil{
			self.image = UIImageView(image: UIImage(named: "rss"))			
			self.loadImage()
		}
	}
    /*
    // Only override drawRect: if you perform custom drawing.
    // An empty implementation adversely affects performance during animation.
    override func drawRect(rect: CGRect) {
        // Drawing code
    }
    */

}
let channelImageDesignImage = ""
